import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Building from "./views/building/buildingView";
import './App.css';


function App() {
  return (
      <Router>
        <Route exact path="/get_Buildings" component={Building} />
      </Router>
  );
}

export default App;
